import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const serverUrl = process.env.REACT_APP_SERVER_URL;

useEffect(() => {
  const authToken = localStorage.getItem("authToken");
  const refreshToken = localStorage.getItem("authToken");
  const navigate = useNavigate();
  if (!authToken || !refreshToken) navigate("/");
  axios.post(`serverUrl/auth/verify`, { headers: { Authorization: "Bearer" } });
}, []);

function PlayerDashboard() {
  return <div className="bg-night w-full h-full">asdasdasdasd</div>;
}

export default PlayerDashboard;
